sources.styles\\reset.scss:
* {
  box-sizing: border-box;
}

html {
  font-family: Ubuntu, sans-serif;
  font-size: 16px;
  line-height: 24px;
  scroll-behavior: smooth;
}

body {
  overflow-x: hidden;
}

body,
nav,
ul,
li,
p {
  margin: 0;
}

a {
  color: $color-blue;
}

sources.styles\\variable.scss:
@mixin content-placement {
  display: flex;
  justify-content: space-between;
}

$logo-width: 115px;
$color-beige: #d5c5aa;
$color-blue: #00aaef;
$color-purple: #4571b2;
$color-gray: #eee;
$color-placeholder: #393939;
$color-white: white;
$color-black: black;
$btn-size: 14px;
$heading-size: 48px;

sources.styles\\header.scss:
.header {
  height: 765px;
  padding: 0 5%;

  background: center / cover no-repeat url(../images/header.jpg);
  position: relative;

  &__nav {
    margin-top: 600px;
  }

  &__call-bar {
    color: $color-white;
    display: flex;
    padding-top: 35px;
    padding-left: 45%;

  }

  &__phone {
    margin: 0 10%;
    white-space: nowrap;
  }

  &__order {
    display: inline;
    text-transform: uppercase;
    white-space: nowrap;
  }

  &__phone,
  &__order {
    position: relative;
    top: 47px;
  }

  &__link {
    color: $color-white;
    text-decoration: none;

    transition: color 0.5s;
    &:hover {
      color: $color-beige;
    }
  }

  @media (max-width: 1170px) {
    &__phone {
      margin: 0 5%;
    }
  }

  @media (max-width: 950px) {
    &__phone {
      margin: 0 3%;
    }
  }

  @media (max-width: 800px) {
    height: 650px;

    &__nav {
      margin-top: 250px;
    }

    &__call-bar {
      flex-direction: column;
      padding-left: 0;
      align-items: center;
    }

    &__phone {
      margin: 0;
    }
  }
}

sources.styles\\logo.scss:
.logo {
  width: $logo-width;
  height: 76px;

  background: center / cover no-repeat url(../images/logo.png);
}

sources.styles\\nav.scss:
.nav {
  white-space: nowrap;

  &__list {
    display: flex;
    justify-content: center;
  }

  &__item {
    margin: 0 42px;
    padding: 7px 20px;

    line-height: 16px;
    font-weight: 500;
    text-transform: uppercase;
    list-style-type: none;

    &-active {
      background-color: $color-beige;
      border-radius: 10px;
      cursor: pointer;

      transition: transform 1s;

      &:hover {
        transform: scale(1.1);
      }
    }
  }

  &__link {
    color: white;
    text-decoration: none;

    transition: color 0.2s;

    &:hover {
      color: $color-beige;
    }

    &-active {
      color: $color-black;
      text-decoration: none;
    }
  }

  @media (max-width: 1170px) {
    &__item {
      margin: 0 auto;
    }
  }

  @media (max-width: 800px) {
    &__list {
      flex-direction: column;
      align-items: center;
      padding: 0;
    }

    &__item {
      font-size: 20px;
      margin-bottom: 5px;
    }
  }
}

sources.styles\\section.scss:
.section {
  position: relative;
  padding: 112px 160px;

  &--bg {
    background-color: $color-gray;
  }

  &--bottom {
    padding-bottom: 65px;
  }

  &__heading {
    left: 0;
    right: 0;
    margin: auto;
    top: -25px;
    position: absolute;
  }

  &__size {
    max-width: 960px;
    margin: 0 auto;
  }

  @media (max-width: 900px) {
    padding: 112px 100px;
  }

  @media (max-width: 600px) {
    padding: 40px 50px;
  }

  @media (max-width: 550px) {
    padding: 40px 0;
  }
}

sources.styles\\info.scss:
.info {
  @include content-placement;

  &__heading {
    margin-right: 5%;
    font-size: $heading-size;
    line-height: 60px;
    font-weight: 300;
    text-transform: uppercase;
  }

  &__link {
    text-decoration: none;
    transition: color 0.5s;

    &:hover {
      color: $color-purple;
    }
  }

  &__text {
    max-width: 560px;
    font-weight: 500;

    & :nth-child(-n+2) {
      margin-bottom: 24px;
    }
  }

  @media (max-width: 980px) {
    &__heading {
      margin: 0 auto;
      font-size: 30px;
      line-height: 40px;
    }

    &__text {
      padding: 0 5%;
      font-size: 14px;
    }
  }

  @media (max-width: 660px) {
    flex-direction: column;

    &__heading {
      margin: 0 auto;
      padding: 0 10%;
      font-size: 30px;
      text-align: center;
    }
  }
}

sources.styles\\heading.scss:
.heading {
  font-size: $heading-size;
  line-height: $heading-size;
  font-weight: 300;
  text-transform: uppercase;
  width: max-content;

  &::before,
  &::after {
    position: absolute;
    top: 100%;

    display: block;
    height: 2px;
    width: calc(50% - 20px);

    content: "";
    background-color: $color-blue;
  }

  &::before {
    left: 0;
  }

  &::after {
    right: 0;
  }

  &__crown {
    display: block;
    width: 30px;
    height: 20px;
    margin: auto;

    position: absolute;
    top: 100%;
    left: 0;
    right: 0;

    background: center / cover no-repeat url(../images/crown.svg);
  }

  @media (max-width: 600px) {
    font-size: 30px;

    &::before,
    &::after {
      top: 90%;
    }

    &__crown {
      top: 90%;
      width: 25px;
      height: 15px;
    }
  }
}

sources.styles\\gallery.scss:
.gallery {

  &__img {
    height: 256px;
    width: calc(50% - 0.5%);
    object-fit: cover;
    object-position: center;
    border-radius: 5px;

    transition: transform 0.2s;

    &:hover {
      transform: translateY(-5%);
    }
  }

  &__photo {
    @include content-placement;

    &--size-top {
      .gallery__img {
        &:first-child {
          width: calc(66% - 0.5%);
        }

        &:last-child {
          width: calc(34% - 0.5%);
        }
      }
    }

    &--size-bottom {
      .gallery__img:first-child {
        width: calc(34% - 0.5%);
      }

      .gallery__img:last-child {
        width: calc(66% - 0.5%);
      }
    }
  }

  &__name_photos {
    margin: 12px 0 35px;
    font-size: 16px;
    line-height: 16px;
    font-weight: 500;

    &--hover {
      transition: color 0.8s;

      &:hover {
        color: $color-purple;
      }
    }
  }

  &__button {
    width: 188px;
    height: 52px;
    margin: 0 auto;
  }

  @media (max-width: 900px) {
    &__img {
      height: 200px;
    }
  }

  @media (max-width: 810px) {
    &__img {
      height: 130px;
    }
  }

  @media (max-width: 550px) {
    margin: 0 3%;
  }
}

sources.styles\\button.scss:
.button {
  display: flex;
  align-items: center;
  justify-content: center;

  font-size: $btn-size;
  line-height: $btn-size;
  font-weight: 500;
  text-transform: uppercase;

  color: $color-white;
  background-color: $color-blue;
  border-color: transparent;
  outline: none;
  cursor: pointer;

  transition: background-color 1s, color 1s;

  &:hover {
    background-color: $color-purple;
    font-weight: 500;
    border: 2px solid $color-purple;
  }

  &--color {
    background-color: $color-blue;
  }
}

sources.styles\\consultation.scss:
.consultation {
  display: flex;
  justify-content: space-between;

  &__heading {
    margin-bottom: 24px;
    font-size: 32px;
    line-height: 40px;
  }

  &__text {
    line-height: 24px;
  }

  &__forms {
    margin-left: 72px;
  }

  @media (max-width: 1000px) {
    flex-direction: column;
    align-items: center;
    margin: 0 auto;

    &__heading {
      margin: 0 auto;
      text-align: center;
      margin-bottom: 10px;
    }

    &__text {
      margin: 0 auto 10px;
      padding: 0 10%;
    }

    &__forms {
      margin: 0;
    }
  }

  @media (max-width: 800px) {
    &__heading {
      font-size: 20px;
    }

    &__text {
      font-size: 13px;
    }
  }
}

sources.styles\\forms.scss:
.forms {
  display: flex;
  flex-direction: column;

  &__item,
  &__button {
    display: flex;
    width: 383px;
    height: 54px;
    margin: 4px 0;

    font-size: $btn-size;
    line-height: 36px;
    font-weight: 500;

    &::placeholder {
      text-transform: uppercase;
      text-align: center;
      color: $color-placeholder;
    }
  }

  &__item {
    padding: 0 5%;
    font-size: 18px;
    background-color: $color-gray;
    border: $color-white;
    outline: none;

    &:focus {
      border: 2px solid $color-blue;
      border-radius: 5px;
    }

    &--message {
      resize: none;
    }
  }

  &__item--size {
    height: 166px;
  }

  @media (max-width: 499px) {
    &__item,
    &__button {
      width: 200px;
      height: 34px;
      font-size: 10px;
    }
  }
}

sources.styles\\testimonials.scss:
.testimonials {
  @include content-placement;

  &__person {
    margin: 0 35px;
  }

  @media (max-width: 800px) {
    flex-direction: column;
    justify-content: center;

    &__person {
      margin-bottom: 25px;
    }
  }
}

sources.styles\\person.scss:
.person {
  display: flex;
  flex-direction: column;
  align-items: center;
  text-align: center;

  &__img {
    width: 150px;
    height: 150px;
    border-radius: 50%;
    margin-bottom: 10px;
  }

  &__name {
    margin: 0;
  }

  &__profession {
    margin: 5px 0 16px;
    opacity: 0.5;
    font-style: italic;
  }

  &__info {
    position: relative;
    max-width: 200px;

    &:after {
      content: "";
      position: absolute;
      right: 100%;
      bottom: 100%;

      display: block;
      width: 40px;
      height: 92px;

      background: 50% / contain no-repeat url(../images/person_Z.png);
    }
  }
}

sources.styles\\contacts.scss:
.contacts {
  @include content-placement;

  &__forms {
    margin-left: 5%;
  }

  &__link {
    color: $color-black;
    text-decoration: none;
    transition: color 0.5s;

    &:hover {
      color: $color-purple;
    }
  }

  &__info {
    max-width: 200px;
    font-size: 24px;
    line-height: 36px;

    & :first-child {
      margin-bottom: 20px;
    }
  }

  @media (max-width: 800px) {
    flex-direction: column;
    align-items: center;

    &__info {
      margin-bottom: 20px;

      &:nth-child(-n+2) {
        margin-bottom: 10px;
      }
    }

    &__forms {
      margin: 0;
    }
  }

  @media (max-width: 499px) {
    &__info {
      font-size: 18px;
      line-height: 26px;
    }
  }
}

sources.styles\\footer.scss:
.footer {
  display: flex;
  height: 540px;
  justify-content: center;

  background: center / cover no-repeat url(../images/footer.jpg);

  &__logo {
    margin: 370px 0 95px;
  }

  @media (max-width: 800px) {
    height: 200px;

    &__logo {
      margin: 70px 0 40px;
    }
  }
